import * as React from "react";
import Singleproduct from "../Singleproduct/Singleproduct";
import "./Content.css";
const Content = ({ list }) => (
  <div className="productContainer">
    {list.map((item) => {
      return <Singleproduct prod={item} key={item.id} />;
    })}
  </div>
);

export default Content;
